import React from 'react';
export default function NavBar(){
    return(
        <div className='nav'>
            <ul className='navbar'>
                <li className='nav-bar'>
                    Home
                </li>
                <li className='nav-bar'>
                    About
                </li>
                <li className='nav-bar'>
                    About
                </li>
            </ul>
        </div>
    );
}
